import React from "react";
import "./Projects.css"

function Projects(props) {
    return (
    <section className="projectsSection" id="projectsSection">
        <h4>Projects in Development</h4>
        <p className="divider"></p>
        <div className="projectsContainer">
           <div className="imgContainer">
                <img src={require("../img/websiteScreenshot.jpg")} alt="Project 1"></img>
                <p>Today, front-end frameworks and libraries are becoming an essential part of the modern web.</p>
            </div>
            <div className="imgContainer">
                <img src={require("../img/pathfindersAdventuresScreenshot.jpg")} alt="Project 2"></img>
            </div> 
        </div>
    </section>
    )
}

export { Projects }
